  \"stillwater-national-wildlife-refuge-stillwater-wildlife-management-area-anaho-island-natio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). The weather in in 1964 was sporadic with many highs
  and lows. Water supplies remain a top priority in refuge management. Two task forces
  were developed to prepare a report on Departmental plans for management for management
  and development of the water resources of the Truckee and Carson River basins. Better
  water management has led to a third consecutive year of increased waterfowl populations.
  A botulism outbreak, however, wiped out an estimated 5,250 birds. Construction included
  cross-diking, the building of boat landings and normal road and structure maintenance.
  Tamarisk control efforts have made a positive difference on the refuge infestation.
  Grazing on the refuge has proved to provide a large revenue with a record number
  of cattle. In addition refuge use and hunting activity increased.\",\n\t\"license_title\":
